pragma solidity ^0.5.0;

// TODO: Add an event to trigger the front page to reload?

contract VoteTranscription {

  // Model a Transcription
  struct Transcription {
    uint id;
    string name;
    uint voteCount;
  }
  // Read/write transcription
  mapping(uint => Transcription) public transcriptions;
  // Store Candidates Count
  uint public transcriptionsCount;

  // Add a transcription to be voted
  function addTranscription (string memory _name) private {
    transcriptionsCount ++;
    transcriptions[transcriptionsCount] = Transcription(transcriptionsCount,
      _name,
      0);
  }

  // Store accounts that have voted
  mapping(address => bool) public voters;

  // Add one vote to one specific transcription
  function vote (uint _id) public {
    // require that the voter has not voted before
    require(!voters[msg.sender]); // This is provided by Solidity
    // require a valid candidate
    require(_id > 0 && _id <= transcriptionsCount);
    // record that voter has voted
    voters[msg.sender] = true;

    // update transcription vote Count
    transcriptions[_id].voteCount ++;
  }

  constructor () public {
    addTranscription("Jian's Transcription");
    addTranscription("Mia's Transcription");
    addTranscription("Brian's Transcription");
    addTranscription("Inno's Transcription");
  }
}
